import '../App.css';

import moment from 'moment';
// React
import { useEffect, useState } from 'react';
import Select from 'react-select';
import Modal from 'react-bootstrap/Modal';
// Material
import TextField from '@mui/material/TextField';
import Tooltip from '@mui/material/Tooltip'
import { IconButton } from '@mui/material'
// Ikony
import { BsFillGearFill } from "react-icons/bs";
// Const
import { SERVER_BASE_URL } from '../helpers/const';
// Axios
import Axios from 'axios';
const source = Axios.CancelToken.source();
const config = { cancelToken: source.token };

const Dashboard = ({ public_tokens, units }) => {
    let unitsSign = '°C';
    let unitsTransfer = 1;
    let stations = [];
    // Stanice
    let [shownStation, setShownStation] = useState();
    let data = [];
    let [shownData, setShownData] = useState();
    // Filtry
    const [showFilterModal, setShowFilterModal] = useState(false);
    let setFilters = {
        
    }
    // UseEffecty
    useEffect(() => {
        setUnitsVariables(units);
        // Získání přístupu ke stanicím
        checkStations();
    }, [])

    useEffect(() => {
        getData();
    }, [shownStation])
    // Axios Calls
    const _logDevice = async (data) => {
        try {
            return await Axios.get(SERVER_BASE_URL + "/devices/log-public", {
                headers: {
                },
                params: {
                    password: data.token,
                },
                config
            });
        } catch (error) {
            //throw new Error(error);
        }
    }

    const _getReportsByDates = async (data) => {
        try {
            return await Axios.get(SERVER_BASE_URL + "/reports/get-by-dates", {
                headers: {
                    token: shownStation,
                },
                params: {
                    start: '',
                    end: ''
                },
                config
            });
        } catch (error) {
            //throw new Error(error);
        }
    }
    // Funkce
    function setUnitsVariables(unit) {
        if (unit === undefined) return;

        if (unit.toUpperCase() === 'FAHRENHEIT') {
            unitsSign = '°F';
            unitsTransfer = 33.8;
        }
    }

    async function checkStations() {
        if (public_tokens === undefined || public_tokens.length <= 0) return;

        for (let i = 0; i < public_tokens.length; i++) {
            let temp = await _logDevice({ token: public_tokens[i] });

            if (temp.length > 0) {
                stations.push(temp);

                if (i === 0) setShownStation(temp);
            }
        }
    }

    async function getData() {
        //
    }

    return (
        <>
            <div className='dashboard-container'>
                {/* Horní bar */}
                <div className='row dashboard-header mx-auto'>
                    <div className='col-sm-12 col-md-12 col-lg-11'>
                        <h3> <b> Měření teploty </b> </h3>
                    </div>
                    <div className='dashboard-header-controls col-sm-12 col-md-12 col-lg-1'>
                        <Tooltip title={"Nastavit filtry"} placement='left'>
                            <IconButton onClick={() => { setShowFilterModal(!showFilterModal) }}>
                                <BsFillGearFill />
                            </IconButton>
                        </Tooltip>
                    </div>
                </div>
                {/* Tělo */}
                <div className='row dashboard-body'>
                    <p> Aktuální teplota: </p>
                    <p> Aktuální vlhkost: </p>
                </div>
            </div>

            <Filter show={showFilterModal} data={setFilters} handleClose={() => { setShowFilterModal(false) }} />
        </>
    )
};

const Filter = ({ show, data, handleClose }) => {
    const [start, setStart] = useState(data.start);
    const [end, setEnd] = useState(data.end);
    return (
        <Modal
            show={show}
            size="lg"
            onHide={handleClose}
            backdrop="static"
            keyboard={false}
        >
            <Modal.Header closeButton>
                <Modal.Title> Úprava  </Modal.Title>
            </Modal.Header>
            <Modal.Body>
                <div className='row'>
                    <div className='col-sm-12 col-md-12 col-lg-7'>
                        <TextField
                            id="date"
                            label="Datum hodiny"
                            type="date"
                            defaultValue={data.start}
                            onChange={(e) => { setStart(e.target.value); }}
                            sx={{ width: 220 }}
                            InputLabelProps={{
                                shrink: true,
                            }}
                        />
                    </div>
                    <div className='col-sm-12 col-md-12 col-lg-1'>
                        <TextField
                            id="date"
                            label="Datum hodiny"
                            type="date"
                            defaultValue={data.end}
                            onChange={(e) => { setEnd(e.target.value); }}
                            sx={{ width: 220 }}
                            InputLabelProps={{
                                shrink: true,
                            }}
                        />
                    </div>
                </div>
            </Modal.Body>
            <Modal.Footer>

            </Modal.Footer>
        </Modal>
    )
}

export default Dashboard;
